import React from "react";
import { Link, useParams } from "react-router-dom";
import "./resetPassword.css";
import jwt_decode from "jwt-decode";
import { useState } from "react";
import Axios from "axios";
import Cookies from "universal-cookie";
import { confirmAlert } from 'react-confirm-alert';

// import ResetPassword from "../resetPassword";

function loginPage(props) {
  const {
    backgroundImage,
    logo,
    text1,
    text2,
    text3,
    emailUsername,
    emailUsernameinputType,
    emailUsernamePlaceholder,
    password,
    passwordinputType,
    passwordPlaceholder,
    text4,
  } = props;

  const [email, setEmail] = useState("");
  const [userPassword, setuserPassword] = useState("");
  const [password_error_message, setPassword_Error_message] = useState("");
  const [incorrectpassword_error_message,setIncorrectpassword_Error_message]=useState('');

  const isEnabled = userPassword.length > 0;

  var passwordMessage = "";


  //incorrect password
  const checkPassword = (value) => {
    if( value.length<8 ){
      setIncorrectpassword_Error_message('Password length should be at least 8 characters');
      }

     else {
      setIncorrectpassword_Error_message('');
  }

}

  // const { userId } = useParams();

  const API_URL = "http://localhost:3000/api/v1/users";


  const { token } = useParams();
  // var token = jwt_decode(token);

  const  resetPassword=()=>{

    // var decoded = jwt_decode(res.data);

    const res = Axios.post(API_URL + "/resetPassword", {
      token: token,
      newPassword: userPassword,
    }).then((res) => {

      console.log(userPassword.length);
      try{

      if (res.data.passwordMessage.passwordMessage){

        passwordMessage=res.data.passwordMessage.passwordMessage;
        setPassword_Error_message(passwordMessage);


      }
      else {
        setPassword_Error_message("");

      }


    }
      catch{
         if (passwordMessage){
          return;
        }



          // alert("Password changed successfully");
          confirmAlert({
            customUI: ({ onClose }) => {
              return (
                <div className='customconfirmAlert'>
                  <h1>Success!</h1>
                  <h5>Password changed successfully.</h5>
                  <button
                  className="yesButton"
                    onClick={() => {
                      onClose();
                    }}
                  >
                    OK
                  </button>
                </div>
              );
            }
          });
                  window.location = "/login-page";

      }
     });
  };




  return (
    <div className="PageCenter">
      <div className="loginPage screen">
        <div className="pageContainer">
          <div className="pageBackground"></div>
          <img className="backgroundImage" src={backgroundImage} />
          <Link to="/home-page">
            <img className="logo" src={logo} />
          </Link>
          <div className="loginComponents">
            <div className="text1">{text1}</div>
            <div className="regContainer">
              <div className="text2">{text2}</div>
              <Link to="/registerPage/reg-page">
                <div className="text3Container">
                  <span className="text3">{text3}</span>
                </div>
              </Link>
            </div>

            {/* login form */}
            <form>
              <div className="inputFildes">
                {/* New password */}
                <div className="loginPasswordContainer">
                  <div className="password-2 nunito-semi-bold-white-28px">
                    {password}
                  </div>
                  <input
                    className="enterPassword  roboto-normal-pink-swan-16px"
                    name="password"
                    placeholder="At least 8 characters"
                    type={passwordinputType}
                    required
                    onChange={(e) => {
                      setuserPassword(e.target.value);
                      checkPassword(e.target.value); 

                    }}
                    minlength="8"
                  />
                  <div className="loginErrorMessage nunito-semi-bold-white-28px">
                    {password_error_message} 
                    {incorrectpassword_error_message}
                  </div>
                </div>

                {/* login button */}
                <div className="buttonContainer">
                  <button
                    type="button"
                    className="loginButton"
                    onClick={resetPassword}
                    disabled={!isEnabled}
                  >
                    <div className="text4 roboto-bold-white-28px">Confirm</div>
                  </button>
                </div>
              </div>
            </form>
          </div>
        </div>
      </div>
    </div>
  );
}

export default loginPage;
